import React from 'react'
import 'react-slideshow-image/dist/styles.css'
import { Fade, Zoom, Slide } from 'react-slideshow-image'

const divStyle = {
    display: 'flex',
    alignItems: "center",
    justifyContent: "center",
    height: "400px",
    backgroundSize: 'cover'
}

const spanStyle = {
    fontSize: "20px",
    background: "efefef",
    color: "#000000"
}

const slideImages = [
    {
      url: 'https://www.google.com/url?sa=i&url=https%3A%2F%2Fblog.admissions.ucla.edu%2F2011%2F09%2F29%2Fthe-most-delicious-thing-in-all-of-the-dining-halls%2F&psig=AOvVaw05mXwLBBAOQnjuZdyWiHgk&ust=1708756205332000&source=images&cd=vfe&opi=89978449&ved=0CBMQjRxqFwoTCJD0kYbrwIQDFQAAAAAdAAAAABAR',
      caption: 'Slide 1'
    },
    {
      url: 'https://images.unsplash.com/photo-1506710507565-203b9f24669b?ixlib=rb-1.2.1&ixid=eyJhcHBfaWQiOjEyMDd9&auto=format&fit=crop&w=1536&q=80',
      caption: 'Slide 2'
    },
    {
      url: 'https://images.unsplash.com/photo-1536987333706-fc9adfb10d91?ixlib=rb-1.2.1&ixid=eyJhcHBfaWQiOjEyMDd9&auto=format&fit=crop&w=1500&q=80',
      caption: 'Slide 3'
    },
  ];


function ImageSlider() {
    return (
        <div className='slide-container'>
            <Fade>
                {slideImages.map((image, index) => (
                    <div key={index}>
                        <div style = {{...divStyle, backgroundImage:`url(${image.url})`}}>
                            <span style={spanStyle}>{image.caption}</span>
                        </div>
                    </div>

                ))}
            </Fade>
        </div>
    )
}

export default ImageSlider;
